import React, { Component } from 'react';
import Slider from "react-slick";
import "./slider.scss";


class My_Slider extends Component {
    state = {}
    render() {
        let slidersettings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1,
            fade: true,
        };
        return (
            <div>
                <Slider {...slidersettings}>
                    <div className="slider">
                        <div cllassName="item" style={{ backgroundImage: url`./photos/photo_1.jpg"` }}>

                        </div>

                    </div>
                </Slider>
            </div >
        );
    }
}

export default My_Slider;
